  \"Rapid Ecological Assessment of Forests in the Laurentian Mixed Forest-Great Lakes
  Coastal Biological Network, Midwest Region, National Wildlife Refuge System, US
  Fish & Wildlife Service: Forest Community Analysis: Seney NWR\",\n\t\"tracking_summary\":
