  false,\n\t\"url\": null,\n\t\"notes\": \"Using relative basal area (%) by species
  of the 112 plots sampled across 11 stands at Seney NWR as part of the Rapid Ecological
  Assessment (Corace et al. 2011), we used a Multi-Response Permutation Procedure
  (MRPP) to examine if there are differences in the overall overstory composition
  among the 11 stands. MRPP is a non-parametric technique that tests the hypothesis
  that there is no difference between groups of entities, in this case the overstory
  composition of stands at Seney NWR.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
